  CONSTRAINT `avatar_ibfk_6` FOREIGN KEY (`avatar_clothes_id`) REFERENCES `avatar_clothes` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

