INSERT INTO `Fit_activity` VALUES 
(1,'10 min LISTT','Upper','Workout Structure<br>5 Exercises; 2 Rounds<br>40 Seconds On, 20 Off<br>Warm Up & Cool Down Not Included<br><br>Exercise Actions:<br>Curl to Overhead Press <br>Tricep Extension to Close Row <br>Chest Press <br>Reverse Fly <br>Lateral & Ventral Raises',90,NULL,'/images/Fit_activity/10_min_LISTT.svg',1,'00:10:00',0),
(2,'12 min LISTT','Upper','Workout Structure<br>Warm Up and Cool Down not included (make sure to do both)<br>Equipment: Dumbbells<br>Muscle Focus: Chest, Upper Back, Biceps, Triceps, Core<br><br>Exercise Actions:<br>Regular Push Up<br>Bent Over Wide Row<br>Wide Push Up<br>Reverse Fly<br>Narrow Push Up<br>Bent Over Close Row<br>',190,NULL,'/images/Fit_activity/12_min_LISTT.svg',2,'00:12:00',0),
(3,'16 min LISTT','Upper','Workout Structure:<br>3 Groups of 2 Exercises<br>2 Sets Each Exercise, in AB,AB Pattern<br>Intervals of 55 On and 20 Off<br><br>Exercise Actions:<br>Chest Fly<br>Bent Over Fly<br>Front Raise<br>Pullovers<br>Tricep Kickback<br>Hammer Curl<br>',210,NULL,'/images/Fit_activity/16_min_LISTT.svg',3,'00:16:00',1),
(4,'20 min ST','Upper','Workout Structure:<br>8 Exercises Total<br>Intervals of 45 On & 15 Off<br>2 Sets each in an AB, AB format<br><br>Exercise Actions:<br>Staggered Hand Push Up<br>Side Push Up<br>Single Leg Push Up<br>Pike Push Up<br>Tricep Push Up<br>Supine Push Up<br>Regular Push Up<br>Tricep Dip<br>',160,NULL,'/images/Fit_activity/20_min_ST.svg',4,'00:20:00',1),
(5,'10 min PT','Core','Workout Structure:<br>This workout uses a 50/10 split for active and rest intervals. <br><br>Exercise Actions:<br>Bent Leg Raise to Hydrant Lift<br>Clamshell to Extension <br>Supine Leg Lift + Reclined Crunch<br>Back Bow + Single Leg Prone Lifts <br>Prone Frogger Lift<br>Bridge: 3 Point Butterfly<br>Single Leg Drop + Leg Split & Crunch<br>',80,NULL,'/images/Fit_activity/10_min_PT.svg',5,'00:10:00',0),
(6,'10 min BLIT','Core','Workout Structure:<br>This workout will do each exercise for 50 seconds,with just a quick ten second <br><br>Exercise Actions:<br>Bicycle Crunch Leg Drops<br>Plank Tucks + Downward Dog Walk<br>Back Bow Toe Touches<br>Leg Pedals, alternating directions<br>Upward Facing Plank + Leg Lifts<br>2 Oblique Crunches + Bridge (arms up to further engage the core)<br>Single Leg Drops<br>Circle Crunches, alternating<br>Bicycle Crunches<br>Mini Scissors<br>',70,NULL,'/images/Fit_activity/10_min_BLIT.svg',6,'00:10:00',0),
(7,'12 min LISTT','Core','Workout Structure:<br>2 Groups of 5 Exercises<br>50 Sec Active 20 Sec Rest<br>One Set Per exercise<br><br>Exercise Actions:<br>Jackknife Getup<br>Back Bow Cross<br>Side Double Leg Raise<br>Windshield Wipers<br>Russian Twist<br>Swimmers<br>Side Hip Raise <br>Butterfly Cross Crunch<br>',120,NULL,'/images/Fit_activity/12_min_LISTT.svg',7,'00:12:00',1),
(8,'18 min CLIPT','Core','Workout Structure:<br>Intervals of 50 Seconds Active, 10 Seconds Rest<br><br>Exercise Actions:<br>Pull Down to Opposite Knee + Squat <br>Wood Choppers (half and half)<br>Opposite Toe Touch Squat<br>Standing Jackknife<br>Toe Touch Crunch + Leg Drop<br>Up And Over Back Bow<br>Side Leg Lift + Lift Back<br>Hydrant + Rear Leg Lift,Reverse Bicycle<br>Side Plank + Dip + Knee,Circle Crunch<br>Plank + Outside Tap + Center Tap <br>Reclined Oblique Crunch (Alternating)<br>Bird Dog Pulses <br>',170,NULL,'/images/Fit_activity/18_min_CLIPT.svg',8,'00:18:00',1),
(9,'10 min STE','Lower','Workout Structure:<br>Equipment: Optional resistance bands, ankle weights, dumbbells<br><br>Exercise Actions:<br>3 Side Steps + 3 Tap Backs<br>Clock Steps,Clock Repeater <br>Switch Sides<br>Reverse Lunge + Calf Raise<br>Curtsy Lunge + Side Raise<br>Squat Steps + Side Lunge<br>Runners,Switch Side<br>Squats<br>',110,NULL,'/images/Fit_activity/10_min_STE.svg',9,'00:10:00',0),
(10,'14 min LIPT','Lower','Workout Structure:<br>35 Seconds Active, 5 Seconds Transition <br>No equipment necessary<br><br>Exercise Actions:<br>Imprint<br>Side Leg Lift (L&R)<br>Up and Back Side Lift<br>Pulses,Clam Shell,Side Plank<br>Kneeling Leg Circles Top<br>Kneeling Leg Circles Bottom<br>Kneeling Curtsy Lift<br>Supine Raise (Alternating)<br>Full Body Stretch<br>',100,NULL,'/images/Fit_activity/14_min_LIPT.svg',10,'00:14:00',0),
(11,'16 min PSTT','Lower','Workout Structure:<br>50 Seconds on, 10 seconds rest<br>Equipment: Dumbbells (optional)<br><br>Exercise Actions:<br>Reverse Leg Lifts,Clam Shell<br>Inside Thigh Raises<br>Fire Hydrant<br>Water Break,Squats <br>Reverse Lunges<br>Assisted Pistol (staggered squat)<br>Deadlifts<br>Sumo Squat Jumps<br>Curtsy Lunge + Outside Thigh Raise<br>Dumbbell Swings,Bridge <br>',231,NULL,'/images/Fit_activity/16_min_PSTT.svg',11,'00:16:00',1),
(12,'20 min LIPT','Lower','Workout Structure:<br>45 Seconds Active, 15 Seconds Rest<br><br>Exercise Actions:<br>Monster Walk<br>Staggered Stance Deadlift<br>Good Morning to Squat,Clock Taps<br>Side Lying Leg Lift<br>Elevated Clamshell with Extension<br>Side Lying Sweeps ,Side Plank Dip<br>Repeat this sequence on both sides of the body<br>Bridge with Step Outs<br>Supine Lift + Hold<br>Up and Over Lifts + Knee to Elbow<br>Bridge + Butterfly,Froggers<br>',150,NULL,'/images/Fit_activity/20_min_LIPT.svg',12,'00:20:00',1),
(13,'10 min CHT','HIIT','Workout Structure:<br>5 Groups of two exercises done in a ABAB pattern<br><br>Exercise Actions:<br>Squats<br>Jumping Lunge<br>Side Leg Raise (L & R)<br>Star Jump<br>Sumo Squat<br>Side Lunge Pop<br>Front Leg Raise (L & R)<br>High Knees<br>Bridge (L & R)<br>Broad Jump<br>',110,NULL,'/images/Fit_activity/10_min_CHT.svg',13,'00:10:00',0),
(14,'16 min CHT','HIIT','Workout Structure:<br>20 On, 10 Off x 3 each<br><br>Exercise Actions:<br>Reverse Lunge Kickouts<br>4 Punches + Knee + Switch<br>Squat Pulses<br>Plank Get Ups<br>Pop Squats<br>Leg Drop Toe Touch<br>Squat + Side Leg Lift<br>Plank Hip Dips<br>2 Ski Squat + 2 Wide Squat Pulses<br>Single Leg Jackknife <br>',190,NULL,'/images/Fit_activity/16_min_CHT.svg',14,'00:16:00',0),
(15,'16 min CH','HIIT','Workout Structure:<br>5 Minute Cardio Warm Up<br>10 Minute HIIT Workout<br><br>Exercise Actions:<br>Boxer Shuffle,Butt Kicker Rows<br>High Knee March,Knee Pull Switches<br>Overhead to Crossover Toe Touch<br>Butt Kickers,Squats,Lunges<br>Side Lunges,Walkdowns<br>Front Kick Touchdowns<br>Jumping Jacks<br>',200,NULL,'/images/Fit_activity/16_min_CH.svg',15,'00:16:00',1),
(16,'20 min CHT','HIIT','Workout Structure:<br>Red Light Green Light HIIT Cardio Workout<br><br>Exercise Actions:<br>Jumping Jacks<br>High Knees<br>Flutterkick Squats<br>Lateral Hop Jumps<br>Squats + Kicks<br>Mountain Climbers<br>Lateral Jumps + Knees<br>Lateral Burpees<br>',260,NULL,'/images/Fit_activity/20_min_CHT.svg',16,'00:20:00',1);
/*!40000 ALTER TABLE `Fit_activity` ENABLE KEYS */;
UNLOCK TABLES;

